import React, { Component } from "react";

class Loader extends Component {
  render() {
    return (
      <div
        className="loader center"
        style={{
          position: "relative",
          left: "50%",
        }}
      >
        <i className="fa fa-spinner fa-spin" />
      </div>
    );
  }
}

export default Loader;
